import "./App.css";
import Home from "./components/Home";
import { JobProvider } from "./components/JobsContext";
import Login from './components/Login'
import Logout from "./components/Logout";

function App() {
  return (
    <JobProvider>
      <div className="App">
        <Home />
        <Login />
        <Logout />

      </div>
    </JobProvider>
  );
}

export default App;
